import React from "react";
import { Link } from "react-router-dom";
import "./header.css";

function Header() {
  return (
    <>
      <header className="header">
        <div>
          <h1>
            <>Shoping Cart</>
          </h1>
          <span>
            {" "}
            <Link to="/">Home</Link>
          </span>
        </div>
        <div>
          <ul>
            <li>
              <Link to="/cart">Cart</Link>
            </li>
          </ul>
        </div>
      </header>
    </>
  );
}

export default Header;
